import React from 'react';
import { BrowserRouter as Router , Route, Switch } from 'react-router-dom';
import ListUser from './ListUser';


function Routes() {
    return (
        <React.Fragment>

           
<Router>
            
                <Switch>
                <Route path="/" exact component={ListUser}/>
                </Switch>
                    
                </Router>              
           

          {/* <ListUser/> */}
          {/* <CreateUser/>
          <UpdateUser/>
          <Login/>
          <Register/> */}
          

        </React.Fragment>
    )
}

export default Routes
